import React from 'react'

export default function AyudaAdmiPage() {
  return (
    <div>
        <div class="d-flex justify-content-center mt-3">
      <div> Ayuda para el modulo de Administracion del Sistema: </div>

      <div class="container square-box d-flex justify-content-center align-items-center mt-3 " style={{maxWidth:300, minHeight:300, borde:1, borderColor:"black" }}> </div>
</div>
    </div>
  )
}
